    string Type;
    bytes32 ChannelId; // Corresponds to common.Hash in Go
    uint256 Amount; // Unsigned integer
    bytes32 ReqBodyHash; // Corresponds to common.Hash in Go
    bytes SignedReqBody; // Dynamic byte array
    uint256 CurrentBlockHeight; // Use uint256 for *big.Int
    bytes ReturnValue; // Dynamic byte array
    bytes[] Proof; // Array of dynamic byte arrays
    bytes32 Address; // Corresponds to common.Address in Go
    // uint256 BlockNr;   // Use uint256 for *big.Int
    bytes Signature; // Dynamic byte array
    bytes32 TxRootHash;
}

event DecodedResponseSP(
    string Type,
    bytes32 ChannelId,
    uint256 Amount,
    bytes32 ReqBodyHash,
    bytes SignedReqBody,
    uint256 CurrentBlockHeight,
    bytes ReturnValue,
    bytes[] Proof,
    bytes32 Address,
    // uint256 BlockNr,
    bytes Signature
);


struct ResponseMsg {
    string Type;
    bytes32 ChannelId;
    uint256 Amount;
    bytes32 ReqBodyHash;
    bytes SignedReqBody;
    uint256 CurrentBlockHeight;
    bytes ReturnValue;
    bytes[] Proof;
    bytes32 TxHash;
    bytes TxIdx;
    bytes Signature;
    bytes32 TxRootHash;
}

event DecodedResponse(
    string Type,
    bytes32 ChannelId,
    uint256 Amount,
    bytes32 ReqBodyHash,
    bytes SignedReqBody,
    uint256 CurrentBlockHeight,
    bytes ReturnValue,
    bytes[] Proof,
    bytes32 TxHash,
    bytes TxIdx,
    bytes Signature
);



event ValuesVerified(bytes[] values);

event msgHash(bytes32 msgHash);
event txHash(bytes32 txHassssh);
event txIdx(bytes txIdx);
event reqByte(bytes SignedReqBody);
event emitProof(bytes[] Proof);
event emitAddress(address signer);

